.text
start_point:
	li $t0, BASE_ADDRESS
	
draw_start:
	beq $t2, 4096, detect_start_initial
	lw $t3, startinitial($t1)
	sw $t3, ($t0)

	addi $t1, $t1, 4
	addi $t0, $t0, 4
	addi $t2, $t2, 1
	
	j draw_start

draw_start_start:
	beq $t2, 4096, detect_start_start
	lw $t3, startstart($t1)
	sw $t3, ($t0)

	addi $t1, $t1, 4
	addi $t0, $t0, 4
	addi $t2, $t2, 1
	
	j draw_start_start

draw_start_exit:
	beq $t2, 4096, detect_start_exit
	lw $t3, startexit($t1)
	sw $t3, ($t0)

	addi $t1, $t1, 4
	addi $t0, $t0, 4
	addi $t2, $t2, 1
	
	j draw_start_exit
	
detect_start_initial:
	li $t0, BASE_ADDRESS
	li $t1, 0
	li $t2, 0
	
	li $s6, 0xffff0000
	lw $s5, 4($s6)
	beq $s5, 0x77, draw_start_start					# ASCII code of 'w' is 0x77
	beq $s5, 0x73, draw_start_exit						# ASCII code of 's' is 0x73
	j detect_start_initial

detect_start_start:
	li $t0, BASE_ADDRESS
	li $t1, 0
	li $t2, 0
	
	li $s6, 0xffff0000
	lw $s5, 4($s6)
	beq $s5, 0x73, draw_start_exit					# ASCII code of 's' is 0x73
	beq $s5, 0x0A, reset_registers
	j detect_start_start

detect_start_exit:
	li $t0, BASE_ADDRESS
	li $t1, 0
	li $t2, 0
	
	li $s6, 0xffff0000
	lw $s5, 4($s6)
	beq $s5, 0x77, draw_start_start					# ASCII code of 'w' is 0x77
	beq $s5, 0x0A, exit_success
	j detect_start_exit
	
exit_success:
	li $v0, 10
	move $a0, $v0
	syscall
	
reset_registers:
	li $v0, 0
	li $v1, 0
	li $a0, 0
	li $a1, 0
	li $a2, 0
	li $a3, 0
	li $t0, 0
	li $t1, 0
	li $t2, 0
	li $t3, 0
	li $t4, 0
	li $t5, 0
	li $t6, 0
	li $t8, 0
	li $t9, 0
	li $s0, 0
	li $s1, 0
	li $s2, 0
	li $s3, 0
	li $s4, 0
	li $s5, 0
	li $s6, 0
	li $s7, 0
	li $k0, 0
	li $k1, 0
	j reset_stack
reset_stack:
	beq $a1, 120, main
	sw $a0, stack_counter($sp)
	addi $a1, $a1, 4

	la $a2, stack_counter
	sw $a1, ($a2)
	j reset_stack
main:
	li $a1, 0
	li $t5, 0	
	sw $t5, 36($sp)
	lw $t0, displayAddress 
	lw $t5, displayAddress
	li $t7, LIME
	li $t8, BROWN
	addi $sp, $sp, -120
	li $a3, 0
	sw $a3, 40($sp)
	li $a3, -1
	sw $a3, 16($sp)
	addi $s7, $t5, PLATFORM

	lw $a3, displayAddress
	addi $a3, $a3, PICKUP1_POS
	sw $a3, 44($sp)
	
	lw $a3, displayAddress
	addi $a3, $a3, PICKUP2_POS
	sw $a3, 96($sp)
	
	lw $a3, displayAddress
	addi $a3, $a3, PICKUP3_POS
	sw $a3, 112($sp)
	
	li $a3, 0 
	sw $a3, 100($sp) # 0 if not jumping, 1 if jumping
	
	sw $a3, 104($sp) # jumping count
	
	
	li $a3, 0
	sw $a3, 48($sp)
	sw $a3, 52($sp)
	sw $a3, 56($sp)
	li $a3, 2
	sw $a3, 84($sp) # health num
	li $a3, 0
	sw $a3, 88($sp) # object 1 collision
	li $a3, PLATFORM2
	addi $a3, $a3, BASE_ADDRESS
	sw $a3, 60($sp)
	
	li $a3, PLATFORM
	addi $a3, $a3, BASE_ADDRESS
	sw $a3, 80($sp)
	
	li $a3, -1
	sw $a3, 68($sp)
	
	move $s5, $s7
	sw $s5, 0($sp) # platform 1 position3
	
	li $s5, 8124
	sw $s5, 4($sp) # platform 2 position
	li $s5, 2684
	sw $s5, 8($sp) # platform 3 position
	
	li $a0, BASE_ADDRESS
	addi $a0, $a0, 14336
	li $a1, 0
	li $a2, 0
	j draw_background

draw_background:
	beq $t2, 3904, draw_fire
	li $t3, BLUE#array($t1)
	sw $t3, ($t0)

	addi $t1, $t1, 4
	addi $t0, $t0, 4
	addi $t2, $t2, 1
	
	j draw_background

draw_fire:
	beq $a2, 512, initialize_platforms
	lw $a3, fire1($a1)
	sw $a3, ($a0)

	addi $a1, $a1, 4
	addi $a0, $a0, 4
	addi $a2, $a2, 1
	
	j draw_fire
	
draw_background_grass:
	beq $t2, 4096, initialize_platforms
	sw $t7, ($t0)
	
	addi $t0, $t0, 4
	addi $t2, $t2, 1
	j draw_background_grass

initialize_platforms:
	addi $a0, $t5, PLATFORM
	
	jal draw_platforms1
	
	addi $a0, $t5, PLATFORM2
	jal draw_platforms2
	
	addi $a0, $t5, PLATFORM3
	jal draw_platforms3
	
	addi $a0, $t5, CHAR_POS
	move $k0, $a0
	jal draw_character
	j main_loop


game_lost:
	li $t0, BASE_ADDRESS
	li $t1, 0
	li $t2, 0
	li $v0, 32
	li $a0, 100
	syscall
	lw $a3, 84($sp)
	beq $a3, 2, draw_game_lost0
	beq $a3, 3, draw_game_lost1
	beq $a3, 4, draw_game_lost2


draw_game_lost0:
	beq $t2, 4096, detect_restart
	lw $t3, lost0($t1)
	sw $t3, ($t0)

	addi $t1, $t1, 4
	addi $t0, $t0, 4
	addi $t2, $t2, 1
	
	j draw_game_lost0
	
draw_game_lost1:
	beq $t2, 4096, detect_restart
	lw $t3, lost1($t1)
	sw $t3, ($t0)

	addi $t1, $t1, 4
	addi $t0, $t0, 4
	addi $t2, $t2, 1
	
	j draw_game_lost1
	
draw_game_lost2:
	beq $t2, 4096, detect_restart
	lw $t3, lost2($t1)
	sw $t3, ($t0)

	addi $t1, $t1, 4
	addi $t0, $t0, 4
	addi $t2, $t2, 1
	
	j draw_game_lost2

game_won:
	li $t0, BASE_ADDRESS
	li $t1, 0
	li $t2, 0
	li $v0, 32
	li $a0, 100
	syscall
	j draw_game_won


draw_game_won:
	beq $t2, 4096, detect_restart
	lw $t3, wincropped($t1)
	sw $t3, ($t0)

	addi $t1, $t1, 4
	addi $t0, $t0, 4
	addi $t2, $t2, 1
	
	j draw_game_won
	
detect_restart:
	li $s5, 0xffff0000
	
	lw $t0, 4($s5)
	beq $t0, 0x70, reset_registers
	j detect_restart
	
main_loop:
	li $s5, 0xffff0000
	lw $s6, 0($s5)
	bne $s6, 1, main_draw
	
	jal keypress
		
	# Redraw objects the new position on the screen.
	main_draw:
		lw $a1, displayAddress
		addi $a1, $a1, HEALTH
		
		lw $a2, 84($sp)
		beq $a2, 2, zero_point
		beq $a2, 3, one_point
		beq $a2, 4, two_point
		beq $a2, 5, three_point

		
		three_point:
		move $a0, $a1
		jal draw_health
		
		addi $a0, $a1, 20
		jal draw_health
		
		addi $a0, $a1, 40
		jal draw_health
		j game_won
		
		two_point:
		move $a0, $a1
		jal draw_health
		
		addi $a0, $a1, 20
		jal draw_health
		
		addi $a0, $a1, 40
		jal draw_health_empty
		j done_health
		
		one_point:
		move $a0, $a1
		jal draw_health
		
		addi $a0, $a1, 20
		jal draw_health_empty
		
		addi $a0, $a1, 40
		jal draw_health_empty
		j done_health
		
		zero_point:
		move $a0, $a1
		jal draw_health_empty
		
		addi $a0, $a1, 20
		jal draw_health_empty
		
		addi $a0, $a1, 40
		jal draw_health_empty
		
		done_health:
		jal key_s
		
		#--- draw pickups --- #
	
		# re draw every 3 cycles

		
		lw $a3, 52($sp)
		bne $a3, 3, skip_pickup
		j update_pickup
		skip_pickup:
			addi $a3, $a3, 1
			sw $a3, 52($sp)
			j update_platforms
		update_pickup:
		li $a3, 0
		sw $a3, 52($sp)
		
		lw $a0, 44($sp) # pickup1 address
		lw $a1, 48($sp) # hover direction
		lw $a3, 96($sp) # pickup2 address
		lw $v0, 112($sp) # pickup3 address
		move $s5, $a0 # p1 previous
		move $s6, $a3 # p2 previous
		move $s4, $v0 # p3 previous
		
		beq $a1, 0, pickup_up
		beq $a1, 1, pickup_down
		beq $a1, 2, pickup_right
		beq $a1, 3, pickup_left
		pickup_up:
			addi $a0, $a0, -SHIFT_NEXT_ROW
			addi $a0, $a0, -SHIFT_NEXT_ROW
			addi $a3, $a3, -SHIFT_NEXT_ROW
			addi $a3, $a3, -SHIFT_NEXT_ROW
			addi $v0, $v0, SHIFT_NEXT_ROW
			li $a1, 2
			j done_pickup
			
		pickup_down:
			addi $a0, $a0, SHIFT_NEXT_ROW
			addi $a0, $a0, SHIFT_NEXT_ROW
			addi $a3, $a3, SHIFT_NEXT_ROW
			addi $a3, $a3, SHIFT_NEXT_ROW
			addi $v0, $v0, -SHIFT_NEXT_ROW
			li $a1, 3
			j done_pickup
		
		pickup_right:
			lw $a2, 56($sp) # wait at right/left for x seconds
			addi $a0, $a0, 4
			addi $a3, $a3, 4
			addi $v0, $v0, -4
			
			addi $a2, $a2, 1
			
			bne $a2, 8, done_pickup
			
			li $a2, 0
			li $a1, 1
			j done_pickup
			
		pickup_left:
			lw $a2, 56($sp) # wait at right/left for x seconds
			addi $a0, $a0, -4
			addi $a3, $a3, -4
			addi $v0, $v0, 4
			
			addi $a2, $a2, 1
			
			bne $a2, 8, done_pickup
			li $a2, 0
			li $a1, 0
			j done_pickup
		
		done_pickup:
		sw $a0, 44($sp)
		sw $a1, 48($sp)
		sw $a2, 56($sp)
		sw $a3, 96($sp)
		sw $v0, 112($sp)
		
		lw $t5, 88($sp)
		beq $t5, 0, drawpickup1
		j skippickup1
		
		drawpickup1:
			move $a0, $s5
			jal clear_pickup
			
			lw $a0, 44($sp)
			jal draw_pickup1
		
		skippickup1:
		lw $t5, 108($sp)
		beq $t5, 0, drawpickup2
		j skippickup2
		
		drawpickup2:
		move $a0, $s6
		jal clear_pickup
		
		lw $a0, 96($sp)
		jal draw_pickup2
		
		skippickup2:
		lw $t5, 116($sp)
		beq $t5, 0, drawpickup3
		j skippickup3
		
		drawpickup3:
		move $a0, $s4
		jal clear_pickup
		
		lw $a0, 112($sp)
		jal draw_pickup3
		
		skippickup3:
		#-- draw platforms --#
		
		update_platforms:
		lw $a0, 60($sp)
		jal clear_platform
		
		move $a0, $s7
		jal clear_platform
		
		
		lw $a3, 16($sp)
		beq $a3, 1, platform_left        	
        	beq $a3, -1, platform_right
        
        	
        	platform_left:
        		addi $k1, $s7, -4
        		lw $t5, 36($sp)
        		addi $t5, $t5, -1
        		sw $t5, 36($sp)
        		beq $t5, 0, change_platform_right
        		
        		# platform 1 left
        		addi $a0, $s7, -4
			addi $s7, $s7, -4
			
			j check_platform2
              		
		
		platform_right:
			addi $k1, $s7, 0
			lw $t5, 36($sp)
        		addi $t5, $t5, 1
        		sw $t5, 36($sp)
        	
        		beq $t5, 15, change_platform_left
        		
        		# platform 1 right
			addi $a0, $s7, 4
			addi $s7, $s7, 4
			move $a0, $k0
			
			j check_platform2
		
		change_platform_right:
			li $a3, -1
			sw $a3, 16($sp)
			j platform_right
			
		change_platform_left:
			li $a3, 1
			sw $a3, 16($sp)
			j platform_left
			
		check_platform2:
        	lw $a3, 68($sp)
		beq $a3, 1, platform_up        	
        	beq $a3, -1, platform_down
        	
        	platform_up:
        		lw $a3, 64($sp)
			bne $a3, 2, skip_update
			
			lw $t5, 72($sp)
        		addi $t5, $t5, -1
        		sw $t5, 72($sp)
        		beq $t5, 0, change_platform_down
        		
			lw $a0, 60($sp)
        		addi $a0, $a0, -SHIFT_NEXT_ROW
        		sw $a0, 60($sp)
        		
        		li $a3, 0
			sw $a3, 64($sp)
		
			j next
		platform_down:
        		# platform 3 down
        		lw $a3, 64($sp)
			bne $a3, 2, skip_update
			
			lw $t5, 72($sp)
        		addi $t5, $t5, 1
        		sw $t5, 72($sp)
        		beq $t5, 20, change_platform_up
        		
			lw $a0, 60($sp)
        		addi $a0, $a0, SHIFT_NEXT_ROW
        		sw $a0, 60($sp)
        		
        		li $a3, 0
			sw $a3, 64($sp)
			
			j next
		
		change_platform_up:
			li $a3, 1
			sw $a3, 68($sp)
			j platform_up
			
		change_platform_down:
			li $a3, -1
			sw $a3, 68($sp)
			j platform_down
			
		skip_update:
			addi $a3, $a3, 1
			sw $a3, 64($sp)
			j next
			
		
			
		next:
			lw $t5, displayAddress
			
			move $a0, $s7
			jal draw_platform1		
			
			lw $a0, 60($sp)
		
			jal draw_platform2
				
			addi $a0, $t5, PLATFORM3
			jal draw_platform3
					

		character_on_platform1:
			lw $a3, 20($sp)
			beq $a3, -1, character_right
			beq $a3, 1, character_left
			j character_on_platform2
			
		character_right:
			jal key_d
			j character_on_platform2
			
		character_left:
			jal key_a
			j character_on_platform2
		
		character_on_platform2:
			lw $a3, 80($sp)
			beq $a3, -1, character_down
			
			beq $a3, 1, character_up
			
			j main_sleep
			
		character_up:

			j main_sleep
			
		character_down:
			jal key_s
			j main_sleep

	# At the end of iteration, main loop sleeps for a bit
	main_sleep: # wait 30 ms
		li	$v0, 32
		li	$a0, 30
		syscall
	j main_loop


keypress:
	lw $t0, 4($s5)
	beq $t0, 0x61, key_a # ASCII code of 'a' 0x61
	beq $t0, 0x77, key_w # ASCII code of 'w' 0x77
	beq $t0, 0x64, key_d # ASCII code of 'd' 0x64
	beq $t0, 0x73, key_s # ASCII code of 's' 0x73
	beq $t0, 0x70, key_p # ASCII code of 'p' 0x70
	
	# key pressed left
	key_a:
		addi $a0, $k0, -8

		li $a1, 9
		
		move $s6, $ra
		jal check_collision_side
		move $ra, $s6
			
		beq $a3, 1, main_loop
		

		addi $k1, $k0, -4
	
        	li $t5, 256
        	div $k1, $t5
        	mfhi $t5
        	beq $t5, 0, main_loop
		
		move $s6, $ra
		move $a0, $k0
		jal clear_character
		move $ra, $s6
		
		addi $k0, $k0, -4
		
		move $s6, $ra
		move $a0, $k0
		jal draw_character
		move $ra, $s6
	
		b key_processed

	# key press up
	key_w:
		addi $a0, $k0, CHARACTER_HEIGHT
		addi $a0, $a0, SHIFT_NEXT_ROW

		li $a1, 11

		move $s6, $ra
		jal check_collision_down
		move $ra, $s6
	
			
		bgtz $a3, first_jump
		
		double_jump:
			lw $a3, 40($sp)
			beq $a3, 1, main_loop #used two jumps
			li $a3, 1
			sw $a3, 40($sp)
			j continue_jump
		
		first_jump:
			li $a3, 0
			sw $a3, 40($sp)
			
		continue_jump:
		lw $s3, displayAddress
		addi $k1, $k0, -SHIFT_NEXT_ROW
	
		li $a3, 1
		sw $a3, 100($sp)
		sw $a3, 104($sp)
		
		move $s6, $ra
		move $a0, $k0
		jal clear_character
		move $ra, $s6
		
		move $k0, $k1
		move $s6, $ra
		move $a0, $k0
		jal draw_character
		move $ra, $s6
		b key_processed

	# key press right
	key_d:
		addi $a0, $k0, CHARACTER_WIDTH

		li $a1, 9
		
		move $s6, $ra
		jal check_collision_side
		move $ra, $s6
			
		beq $a3, 1, main_loop
		
		addi $k1, $k0, 0
		li $t5, 256
        	div $k1, $t5
        	mfhi $t5
        	beq $t5, 212, main_loop
        	
        	move $s6, $ra
		move $a0, $k0
		jal clear_character
		move $ra, $s6
		
        	addi $k0, $k0, 4
		
		move $s6, $ra
		move $a0, $k0
		jal draw_character
		move $ra, $s6
		b key_processed
	# key press down
	key_s:	
		lw $a3, 100($sp)
		beq $a3, 1, gradual_jump
		
		j not_jumping
		
		gradual_jump:
			lw $a3, 104($sp)
			addi $a3, $a3, 1
			sw $a3, 104($sp)
			beq $a3, 15, end_jump
			
			addi $k1, $k0, -SHIFT_NEXT_ROW
			
			li $a1, 11	
			move $a0, $k1
			move $s6, $ra
			jal check_collision_up
			move $ra, $s6
			beq $a2, 1, end_jump
			

			j not_on_platform
		
		end_jump:
			li $a3, 0
			sw $a3, 100($sp)
			sw $a3, 104($sp)
			
		not_jumping:
		addi $k1, $k0, SHIFT_NEXT_ROW
		addi $s5, $k1, CHARACTER_HEIGHT
	
		addi $a0, $k0, CHARACTER_HEIGHT
		addi $a0, $a0, SHIFT_NEXT_ROW
		li $a1, 10
		li $a3, 0

		move $s6, $ra		
		jal check_collision_down
		move $ra, $s6
		
		beq $a3, 0, not_on_platform
		beq $a3, 1, key_processed
		beq $a3, 2, move_character_vertical
		beq $a3, 3, key_processed
		beq $a3, 4, game_lost
		
		move_character_side:
			lw $a3, 16($sp)
			
			beq $a3, -1, set_right
			beq $a3, 1, set_left
		
		set_right:
			li $a3, -1
			sw $a3, 20($sp)
			b key_processed
			
		set_left:
			li $a3, 1
			sw $a3, 20($sp)
			b key_processed

		move_character_vertical:
			lw $a3, 68($sp)
			
			beq $a3, -1, set_down
			beq $a3, 1, set_up
		
		set_down:
			li $a3, -1
			sw $a3, 80($sp)
			b key_processed
			
		set_up:
			li $a3, 1
			sw $a3, 80($sp)
			addi $k1, $k0, -SHIFT_NEXT_ROW
			sw $k1, 92($sp)
			
			move $a0, $k0
			move $t5, $ra
			jal clear_character
			move $ra, $t5
			
			move $k0, $k1
			move $a0, $k1
			move $t5, $ra
			jal draw_character
			move $ra, $t5
			b key_processed
		#--
		not_on_platform:
			li $a3, 0
			sw $a3, 20($sp)
			sw $a3, 80($sp)

		move $s6, $ra
		move $a0, $k0
		jal clear_character
		move $ra, $s6
		move $k0, $k1
		
		move $s6, $ra
		move $a0, $k0
		jal draw_character
		move $ra, $s6
		
		b key_processed

	key_p:
		# restart game
		la $ra, reset_registers
		b key_processed

	key_processed:
		jr $ra


            
check_collision_side:
	# $a0 - bottom left pixel of object
	# $a1 - length of object
	# $a2 - colour of collision 
	# $a3 - return value (1 if collision, 0 if none)
	lw $t0, ($a0)
	#lw $a2, ($a0)
	
	bne $t0, BLUE, collision_detected # if $a2 =/= BLUE, collision is detected
	
	addi $a0, $a0, 256
	
	addi $a1, $a1, -1
	bgez $a1, check_collision_side
	li $a3, 0
	jr $ra

check_collision_up:
	# $a0 - bottom left pixel of object
	# $a1 - length of object
	# $a2 - colour of collision 
	# $a3 - return value (1 if collision, 0 if none)
	lw $t0, ($a0)
	
	beq $t0, PICKUP1, destroy_pickup1
	beq $t0, PICKUP4, destroy_pickup2
	beq $t0, GREEN, destroy_pickup3
	bne $t0, BLUE, collision_detected # if $a2 =/= BLUE, collision is detected
	
	addi $a0, $a0, 4
	
	addi $a1, $a1, -1
	bgez $a1, check_collision_up
	li $a3, 0
	jr $ra

destroy_pickup1:
	lw $a3, 84($sp)
	addi $a3, $a3, 1
	sw $a3, 84($sp)
	li $a3, 1
	sw $a3, 88($sp)
	
	move $a2, $a0
	
	lw $a0, 44($sp)
	move $s5, $ra
	jal clear_pickup
	move $ra, $s5
	move $a0, $a2
	
	li $a3, 1
	jr $ra

destroy_pickup2:
	lw $a3, 84($sp)
	addi $a3, $a3, 1
	sw $a3, 84($sp)
	
	li $a3, 1
	sw $a3, 108($sp)
	move $a2, $a0
	lw $a0, 96($sp)
	move $s5, $ra
	jal clear_pickup
	move $ra, $s5
	move $a0, $a2
	li $a3, 1
	jr $ra
	
destroy_pickup3:
	lw $a3, 84($sp)
	addi $a3, $a3, 1
	sw $a3, 84($sp)
	
	li $a3, 1
	sw $a3, 116($sp)
	move $a2, $a0
	lw $a0, 112($sp)
	move $s5, $ra
	jal clear_pickup
	move $ra, $s5
	move $a0, $a2
	li $a3, 1
	jr $ra
	
check_collision_down:
	# $a0 - bottom left pixel of object
	# $a1 - length of object
	# $a2 - colour of collision 
	# $a3 - return value (3 if moving side, 2 if moving vertical, 1 if collision, 0 if none)
	lw $t0, ($a0)
	
	beq $t0, FIRE_COLOR, end_game
	beq $t0, PICKUP1, destroy_pickup1 # 1
	beq $t0, PICKUP4, destroy_pickup2 # 1
	beq $t0, GREEN, destroy_pickup3 # 1
	beq $t0, PLATFORM1_COLOR, collision_detected_leftright # if $t0 = PLAT1, collision is detected
	beq $t0, PLATFORM2_COLOR, collision_detected_updown# if $t0 = PLAT2, collision is detected
	bne $t0, BLUE, collision_detected
	
	addi $a0, $a0, 4
	
	addi $a1, $a1, -1
	bgez $a1, check_collision_down
	li $a3, 0
	jr $ra

end_game:
	li $a3, 4
	jr $ra
collision_detected:
	li $a3, 1
	jr $ra
	
collision_detected_updown:
	li $a3, 2
	jr $ra
	
collision_detected_leftright:
	li $a3, 3
	jr $ra

